import java.util.Scanner;public class Main {	final static Scanner sc = new Scanner(System.in);	public static void main(String[] args) {		long tar = 59084709587505L;		long cnt = 0;		for (int i = 0; Math.pow(3, i) <= tar; i++) {			for (int j = 0; Math.pow(5, j) <= tar; j++) {				for (int k = 0; Math.pow(7, k) <= tar; k++) {					if (Math.pow(3, i) * Math.pow(5, j) * Math.pow(7, k) <= tar) {						cnt++;					}				}			}		}		System.out.println(cnt - 1);	}}